import React, { useEffect } from "react"
import { useDispatch, useSelector } from "react-redux"
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import Home from './components/body/home/Home';
import Shop from './components/body/shop/Shop'
import CardProduct from './components/body/shop/CardProduct'
import Footer from "./components/footer/Footer"
import FoodBranch from "./components/body/shop/FoodBranch";
import Login from "./components/body/helper/login/Login"
//Action 

import {
  getDataPizza, getDataSushi,
  getDataHamburger, getDataPancake,
  getDataDumplings, getDataCupcake,
  getDataChicken, getDataNoodle,
  getDataSalad
} from "./features/dataCreateAsyncThunk";

const App = () => {

  const dispatch = useDispatch()
  const data = useSelector(state => state)
  useEffect(async() => {
    await dispatch(getDataPizza())
    // await dispatch(getDataSushi())
    // await dispatch(getDataHamburger())
    // await dispatch(getDataPancake())
    // await dispatch(getDataDumplings())
    // await dispatch(getDataCupcake())
    // await dispatch(getDataChicken())
    // await dispatch(getDataNoodle())
    // await dispatch(getDataSalad())
  }, [dispatch])

  return (
    <div className="App">
      <Router>  
        <Routes>
          {/* <Route exact path="shop" element={<Shop data={data} />} ></Route> */}
          <Route path="/shop/:slug" element={<FoodBranch data={data} />}></Route>
          <Route path="/login" element={<Login />} />
          <Route path="/" element={<Home data={data}/>} />
        </Routes>
          {/* <Footer /> */}
      </Router>
    </div>
  );
} 

export default App;
